import React from 'react';
import { Link, useLocation } from 'react-router-dom';
import { 
  AppBar, Toolbar, Typography, Container, Box, Drawer, List,
  ListItem, ListItemIcon, ListItemText, Divider, IconButton
} from '@mui/material';
import DashboardIcon from '@mui/icons-material/Dashboard';
import CloudIcon from '@mui/icons-material/Cloud';
import SecurityIcon from '@mui/icons-material/Security';
import VerifiedIcon from '@mui/icons-material/Verified';
import MenuIcon from '@mui/icons-material/Menu';

const drawerWidth = 240;

const Layout = ({ children }) => {
  const location = useLocation();
  const [mobileOpen, setMobileOpen] = React.useState(false);

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const drawer = (
    <div>
      <Box sx={{ p: 2 }}>
        <Typography variant="h6" component="div">
          FedRAMP KSI
        </Typography>
      </Box>
      <Divider />
      <List>
        <ListItem 
          button 
          component={Link} 
          to="/" 
          selected={location.pathname === '/'}
        >
          <ListItemIcon>
            <DashboardIcon />
          </ListItemIcon>
          <ListItemText primary="Dashboard" />
        </ListItem>

        <ListItem 
          button 
          component={Link} 
          to="/provider/aws" 
          selected={location.pathname === '/provider/aws'}
        >
          <ListItemIcon>
            <CloudIcon />
          </ListItemIcon>
          <ListItemText primary="AWS" />
        </ListItem>

        <ListItem 
          button 
          component={Link} 
          to="/provider/azure" 
          selected={location.pathname === '/provider/azure'}
        >
          <ListItemIcon>
            <CloudIcon />
          </ListItemIcon>
          <ListItemText primary="Azure" />
        </ListItem>

        <ListItem 
          button 
          component={Link} 
          to="/provider/gcp" 
          selected={location.pathname === '/provider/gcp'}
        >
          <ListItemIcon>
            <CloudIcon />
          </ListItemIcon>
          <ListItemText primary="GCP" />
        </ListItem>
      </List>
      <Divider />
      <List>
        <ListItem 
          button 
          component={Link} 
          to="/controls" 
          selected={location.pathname === '/controls'}
        >
          <ListItemIcon>
            <SecurityIcon />
          </ListItemIcon>
          <ListItemText primary="Control Catalog" />
        </ListItem>

        <ListItem 
          button 
          component={Link} 
          to="/validation" 
          selected={location.pathname === '/validation'}
        >
          <ListItemIcon>
            <VerifiedIcon />
          </ListItemIcon>
          <ListItemText primary="KSI Validation" />
        </ListItem>
      </List>
    </div>
  );

  return (
    <Box sx={{ display: 'flex' }}>
      <AppBar
        position="fixed"
        sx={{
          width: { sm: `calc(100% - ${drawerWidth}px)` },
          ml: { sm: `${drawerWidth}px` },
        }}
      >
        <Toolbar>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ mr: 2, display: { sm: 'none' } }}
          >
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" noWrap component="div">
            FedRAMP Controls Validation
          </Typography>
        </Toolbar>
      </AppBar>

      <Box
        component="nav"
        sx={{ width: { sm: drawerWidth }, flexShrink: { sm: 0 } }}
      >
        <Drawer
          variant="temporary"
          open={mobileOpen}
          onClose={handleDrawerToggle}
          ModalProps={{
            keepMounted: true, // Better open performance on mobile.
          }}
          sx={{
            display: { xs: 'block', sm: 'none' },
            '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
          }}
        >
          {drawer}
        </Drawer>
        <Drawer
          variant="permanent"
          sx={{
            display: { xs: 'none', sm: 'block' },
            '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
          }}
          open
        >
          {drawer}
        </Drawer>
      </Box>

      <Box
        component="main"
        sx={{ 
          flexGrow: 1, 
          p: 3, 
          width: { sm: `calc(100% - ${drawerWidth}px)` },
          mt: 8 // Add margin top to push content below app bar
        }}
      >
        {children}
      </Box>
    </Box>
  );
};

export default Layout;
